import React from "react";

function DriverInfo(){
    return(
        <div className="driver-info">
            <div className="input-box">
                <p>First Name</p>
                <input type="text" style={{width: "200px"}}/>
            </div>

            <div className="input-box">
                <p>Last Name</p>
                <input type="text" style={{width: "200px"}}/>
            </div>

            <div className="input-box">
                <p>Age</p>
                <input type="text" style={{width: "100px"}}/>
            </div>
        </div>
    );
}

export default DriverInfo;
